import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Typography } from '@mui/material';

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159),
  createData('Ice cream sandwich', 237),
];

export default function BasicTable() {
  return (
    <>
      <Typography sx={{fontSize:"20px",fontFamily:'Inter',fontWeight:"800",color:"#1A191D"}}>New Uers</Typography>
      <TableContainer component={Paper} sx={{ boxShadow: 'none', border: 'none' }}>
      <Table sx={{ minWidth: 250, border: 'none' }} aria-label="simple table">
        <TableBody>
          {rows.map((row, index) => (
            <TableRow
              key={row.name}
              sx={{
                '&:last-child td, &:last-child th': { border: 0 },
                borderBottom: index < rows.length - 1 ? '1px solid rgba(224, 224, 224, 1)' : 'none',
              }}
            >
              <TableCell component="th" scope="row" sx={{ padding: '6px', borderBottom: 'none' }}>
                {row.name}
              </TableCell>
              <TableCell sx={{ padding: '6px', borderBottom: 'none' }}>{row.calories}</TableCell>
              <TableCell sx={{ padding: '6px', borderBottom: 'none' }}>{row.fat}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </>

  );
}
